/* eslint-disable react/jsx-no-target-blank */
import React from "react"
import './Index.css'

export default function Footer(){
    return(
        <footer className="foot">
            <span>© Copyright 2021 - <a href='https://www.jeffelobato.com' target='_blank'>Jefferson Lobato</a> | <a href='https://www.jeffelobato.com/politica.php' target='_blank'>Política de Privacidade</a></span>
        </footer>
    )
}
